import { Link } from 'react-router-dom';

function OurTeam() {
    return (
        <div className='Team'>
            <p>Our Team</p>
            <Link to='/'>Portal</Link>
            <Link to='/home'>Home</Link>
        </div>
    )
}

export default OurTeam;
